import React from "react";
import "./header.css";

const Header = () => {
  return (
    <div className="header">
      <h3 className="logo"> Falafelm√§staren </h3>
      <div className="top-right">
        {" "}
        <img
          className="hero-image"
          src={require("../../images/falafel-icon.sg")}
          alt="falafel"
        />
      </div>
    </div>
  );
};

export default Header;
